INSERT INTO `reve` VALUES (2,'1- Je me suis endormie en pensant à l\'être cher, mon cœur battant pour lui. \r\nDans mon rêve, je me promenais dans un champ de fleurs multicolores, le soleil réchauffant ma peau.\r\n Soudain, j\'ai entendu un bruissement derrière moi et en me retournant, j\'ai vu mon amour qui \r\ns\'approchait de moi. Il m\'a pris par la main et m\'a emmené dans une clairière où il avait \r\npréparé un pique-nique romantique avec toutes mes friandises préférées.\r\n\r\nNous avons mangé et ri ensemble, et je me suis sentie plus heureuse que jamais. \r\nPuis il a sorti une bague de sa poche, s\'est agenouillé et m\'a demandé de l\'épouser. \r\nLes larmes ont coulé sur mon visage alors que je lui disais oui, heureuse de passer le reste \r\nde ma vie avec lui. Je me suis réveillée avec un sourire sur les lèvres, sachant que c\'était \r\nle début d\'une belle journée.','2022-05-20',1,92,22,'Rêve de voler','Rêve amoureux'),(3,'Je suis tombé(e) endormi(e) comme d\'habitude, mais cette nuit-là, quelque chose était différent. \r\nJe me suis soudainement rendu(e) compte que j\'étais en train de rêver. Émerveillé(e) par cette \r\ndécouverte, j\'ai commencé à explorer mon rêve. J\'ai regardé autour de moi, observant chaque détail\r\n de mon environnement onirique. J\'ai vu des couleurs vives et des paysages fantastiques que je\r\n n\'avais jamais vus auparavant.\r\n\r\nSoudain, j\'ai réalisé que je pouvais tout faire, je pouvais voler, changer mon apparence, \r\nvoyager dans le temps ou encore, visiter des mondes imaginaires. J\'ai commencé à explorer mes \r\nlimites et j\'ai réalisé que tout était possible. Cependant, je ne pouvais m\'empêcher de penser \r\nà la personne que j\'aimais et j\'ai décidé de créer un paysage romantique pour nous deux. J\'ai créé \r\nun magnifique jardin avec des fleurs de toutes les couleurs et des fontaines qui coulaient de \r\npartout.\r\n\r\nJe suis allé chercher l\'être aimé et l\'ai emmené(e) dans le jardin. Nous avons \r\ndansé sous les étoiles et avons échangé des baisers passionnés. J\'ai savouré chaque\r\n instant de ce rêve lucide et j\'ai promis de m\'entraîner pour vivre plus de rêves de ce genre.','2023-02-20',1,74,1,'Je ne rêvais pas','Lucide'),(7,'Je suis dans un couloir sombre et froid, seule et terrifiée. \r\nJe ne sais pas comment je suis arrivé(e) là, mais je sais que quelque chose de maléfique me \r\npoursuit. Je sens sa présence, je l\'entends respirer, mais je ne peux pas le voir.\r\nJe commence à courir dans le couloir, cherchant désespérément une issue. Mais peu importe \r\noù je vais, le couloir semble s\'étendre indéfiniment. Mes jambes sont lourdes et je commence \r\nà m\'épuiser, mais je ne peux pas m\'arrêter. Je sais que si je m\'arrête, quelque chose de terrible \r\nva se passer.\r\nSoudain, je vois une ombre se rapprocher de moi. Je commence à paniquer et je cours encore plus \r\nvite. L\'ombre devient de plus en plus grande, plus sombre, plus menaçante. J\'essaie de crier, \r\nmais aucun son ne sort de ma bouche.\r\nJe sens une main froide et griffue attraper mon épaule, me faisant tomber au sol. Je suis face à \r\nface avec l\'horreur, une créature difforme et sanguinaire qui me fixe avec ses yeux rouges. \r\nJe suis pétrifié(e) par la peur alors \r\nque ses griffes commencent à me lacérer la peau.\r\n\r\nJe me réveille en sueur, réalisant que c\'était un cauchemar, mais l\'image de la créature me \r\nhante encore. Je suis incapable de dormir à nouveau, terrifié(e) à l\'idée de revivre ce cauchemar \r\népouvantable.','2023-02-21',2,72,37,'Créature effrayante','Terrifiant'),(8,'Je suis seul(e) dans un monde vide et stérile, sans personne autour de moi. \r\nJe cherche désespérément des signes de vie, mais il n\'y a rien, pas un bruit, \r\npas un mouvement. Je me sens abandonné(e) et sans espoir.\r\n\r\nJe commence à marcher, cherchant un endroit où je pourrais trouver quelqu\'un. \r\nMais plus je marche, plus je réalise à quel point je suis seul(e). Je commence \r\nà paniquer, me demandant si je serai toujours seul(e) pour le reste de ma vie. \r\nMes pensées deviennent sombres et je commence à imaginer des scénarios où je suis \r\nabandonné(e) pour toujours.\r\n\r\nJe me mets à crier, implorant quelqu\'un, n\'importe qui, de venir à mon secours. \r\nMais personne ne répond, il n\'y a que le silence. La peur m\'envahit et je commence \r\nà me sentir comme si j\'étais enfermé(e) dans un monde sans fin.\r\nJe me réveille en sueur, soulagé(e) de réaliser que c\'était un cauchemar. Mais \r\nl\'idée d\'être abandonné(e) et seul(e) me hante encore, me laissant une impression de \r\nsolitude et de tristesse..','2023-02-21',2,79,33,'Seul au monde','Rêve d\'abandon'),(14,'oooooooooooooooo','2023-02-24',1,92,1,'oooooooooo','Lucide'),(15,'jjjjjjjjjjjjj','2023-02-24',1,92,1,'jjjjjjjjjjjj','Lucide'),(16,'test test test ','2023-02-24',1,92,1,'reve test','Lucide'),(17,'cccccccccccccccccccc','2023-02-25',1,92,1,'      cccccccccccccccccccccccccccccccccc','Lucide'),(18,'ddddddddddddddddddddddddd','2023-02-26',1,92,1,'dddddddddddddddddd','Lucide'),(19,'tryyyyyyyyyyyyyyyyyyyyyyyyyyyyyyyyyyyyyyyyyyyyy','2023-02-26',2,92,33,'test','Rêve de catastrophe'),(20,'je rêve d\'amour , de te rencontrer !Oh oui je te vois dans mes rêves , viens me parler !','2023-02-28',1,92,22,'oh mon amour','Rêve amoureux'),(21,'revons tous ensemble','2023-02-28',1,92,6,'revons tous ensembleeeee','Rêve collectif'),(22,'je fais toujours le meme reve','2023-02-28',1,92,3,'je fais toujours ce reve','Rêve recurrent'),(23,'aaaah Patrice Lafond.. si seulement... \r\nChacun ses gouts j\'fais ce que je veux !','2023-02-28',1,92,23,'aaaah patrice.;.','Rêve érotique'),(24,'capitaine capitaine regardez là... LAAA!!! Y a rien!!! Ya rien du tout!!!!','2023-02-28',2,92,35,'oh mon dieuu','Rêve de catastrophe'),(25,'\"Je me suis vu en train de marcher sur un chemin sombre et étroit qui se dirigeait vers une montagne imposante. Tout à coup, j\'ai entendu un bruit sourd et j\'ai vu un éclair dans le ciel. J\'ai senti une énergie électrique intense et j\'ai su que quelque chose de grave allait se passer. Plus tard, j\'ai appris qu\'une catastrophe naturelle avait eu lieu dans la région montagneuse que j\'avais vue dans mon rêve.\"','2023-02-28',1,92,2,'Je le savais ...','Rêve prémonitoire'),(26,'Rêver de la mort est quelque chose qui m\'arrive très souvent . Je me demande pourquoi, je me demande même si il y a une bonne raison à cela ... Est ce que quelqu\'un rêve comme moi de ce genre de chose ?\r\n\r\n\r\nEst ce que ce genre de rêve a une signification? Si quelqu\'un a des réponses ... n\'hésitez pas à en parler avec moi. ','2023-03-02',2,92,36,'Sueurs froides','Terrifiant'),(27,'Je rêve souvent de me retrouver seule ... parfois même d\'avoir peur de me retrouver seule . \r\n\r\nPourquoi?Je ne sais pas . Je suis entourée dans ma vie de tous les jours mais cela n\'empêche que ce genre de rêves me poursuis . \r\n\r\nDans mes rêves je suis souvent aux côté de quelqu\'un et je ne sais pas pourquoi,je sais que cette personne va me laisser seule et disparaitre... et c\'est exactement ce qui se passe.\r\n\r\nJe me dis parfois que cette réelle peur de l\'abandon se repercute sur mes rêves ... Si d\'autres personnes sont dans mon cas cela m\'interesse. \r\n\r\n','2023-03-02',2,103,38,'Peur de l\'abandon','Rêve d\'abandon'),(28,'Je ne comprends pas pourquoi dans mes rêves ... je m\'attends toujours à une catastrophe . \r\nJe rêve parfois d\'être dans un immeuble sans aucun mur...\r\nen face de cet immeuble sans mur se trouve un ocean ... et je ressens de la peur , je ne sais pas pourquoi mais je cherche à me cacher... je cherche un mur pour me cacher ... mais il n\'y en a pas. \r\n\r\npuis arrive un énorme vaisseaux au dessus de l\'océan , qui balance plusieurs être humain dans cet océan . Oui cela semble plutôt drôle mais lorsqu\'on fait ce même rêves depuis plusieurs années forcément c\'est inquiétant ... haha','2023-03-02',2,104,3,'Fin du monde','Rêve de catastrophe'),(29,'J\'ai un peu de l\'échec c\'est juste incroyable...\r\n\r\nJe rêve parfois de n\'avoir aucune force , aucune intelligence et pourtant une envie terrible d\'être la meilleure version de moi même et satisfaire les autres. Dans mes rêves je n\'y parviens jamais ... \r\nPourquoi ? Est ce parce que dans ma vie réelle j\'ai peur de décevoir ? ','2023-03-02',2,105,40,'Toujours peur d\'échouer','Rêve d\'échec'),(30,'Dans mon rêve je cherche l\'amour mais ne le trouve pas et pourtant dans la réalité il existe . C\'est étrange est ce un signe ? ','2023-03-02',1,110,22,'lala vous raconte tout','Rêve amoureux'),(31,'Il sont là , partout autour de moi... Ils envahissent ma vie , sont dans toutes les pièces de ma maison je ne peux circuler sans les voir roder partout et mon dieu leurs visages...  \r\n\r\nIls mangent tout ce qu\'ils trouvent, utilisent ce qui est à moi sans me demander la permission. Je n\'ose même plus toucher à mes affaires, je m\'enferme dans ma chambre à clé ... \r\nLeurs façon de râler, ses cris incessant... cela devient insupportable . Ils ne font que manger, dormir, râler  . Je ne peux plus voir ma belle famille !','2023-03-02',2,110,32,'Ces  monstres sont  partouuuut!','Terrifiant'),(32,'Malheureusement dans la vie NADA!','2023-03-02',1,110,23,'Rêve super super hot ','Rêve érotique'),(33,'On rêve de \"sauver la planète\"... ouai on rêve bien tous ensemble . ','2023-03-02',1,107,6,'On fait tous de rêve collectif','Rêve collectif'),(34,'. Je rêve souvent d\'avoir les dents qui tombent . Je ne sais pas c\'est bizarre de rêver de ce genre de chose aussi souvent non? \r\nVous en pensez quoi vous ?','2023-03-02',1,107,3,'mes dents tombent dans mes mains','Rêve récurrent'),(35,'Non sérieux , je ne cesse de rêver de chose érotiques . Cela me travaille beaucoup visiblement . Est ce que je suis en manque de tendresse? Je rencontre pourtant pas mal de femmes ... bizarre bizarre. Qui fait aussi ce genre de rêve? ','2023-03-02',1,109,23,'nico dans des nuages roses','Rêve érotique'),(36,'Pourquoi j\'ai peur d\'échouer non seulement dans la vie réelle mais aussi dans mes rêves ? Cela devient une réelle obsession et au final je fini par avoir peur de tenter quoi que ce soit à cause de ce problème...','2023-03-02',2,109,40,'Manque de confiance en moi? ','Rêve d\'échec'),(37,'Depuis tout petit, j\'ai peur du feu . Cela va jusque dans mes cauchemars . Je me vois dans un environnement rassurant ou rien ne semble pouvoir arriver de negatif. Puis d\'un coup d\'un seul tout s\'enflamme et mon coeur est à la limite d\'exploser et là je me réveil!','2023-03-02',2,109,35,'incendie','Rêve de catastrophe'),(38,'Il m\'arrive d\'avoir cette impression de rêve éveillé...\r\nJ\'entends une voix qui me dit que je n\'ai plus le temps et que je dois me depecher. \r\nJe l\'entends réellement , je ne suis pas dingue . \r\nEst ce que quelqu\'un ici a déjà vécu cela ? ','2023-03-02',1,109,1,'Paroifs on pense rêver mais c\'est bien réel.','Lucide'),(39,'je ne veux pas echouer j\'ai toujours peur de l\'échec !!','2023-03-07',2,92,40,'je ne veux pas echouer','Rêve d\'échec'),(40,'La terre tremble dans mes rêves ....','2023-03-15',2,92,35,'Tremblement de terre ','Rêve de catastrophe'),(41,'je partage un reve erotique ','2023-03-15',1,92,23,'reve erotique ',''),(42,'j\'espère qu\'il n\'échoue pas','2023-04-04',2,112,40,'ce reve nest qu\'un test',''),(43,'Je suis dans un champ de fleurs colorées, baigné par le soleil chaud de l\'après-midi. Soudain, je sens une main chaude et douce prendre la mienne. Je me retourne et je vois la personne que j\'aime le plus au monde. Nous sourions l\'un à l\'autre et nous commençons à nous promener dans le champ, nos doigts entrelacés.\r\n\r\nNous sommes entourés de couleurs et de parfums magnifiques, mais nous ne voyons que l\'un l\'autre. Nous marchons jusqu\'à un arbre immense et majestueux qui offre une ombre fraîche et accueillante. Nous nous asseyons sous l\'arbre et nous nous blottissons l\'un contre l\'autre, en écoutant le chant des oiseaux et le bruit du vent dans les feuilles.\r\n\r\nNous parlons doucement, partageant nos rêves et nos espoirs les plus profonds. Je regarde dans les yeux de la personne que j\'aime, et je vois un mélange d\'amour, de tendresse et de passion qui me fait fondre. Nous nous embrassons, et c\'est comme si le temps s\'arrête. Nous sommes perdus dans notre amour l\'un pour l\'autre, sans souci ni préoccupation dans le monde.\r\n\r\nLe soleil commence à se coucher, et nous nous levons lentement, la main dans la main. Nous regardons le coucher du soleil ensemble, avec une gratitude infinie pour l\'amour que nous partageons. Nous savons que quoi qu\'il arrive dans le futur, nous serons toujours ensemble, et que rien ne pourra jamais séparer notre amour.','2023-04-13',1,113,22,'Un jour mon prince viendra...',''),(44,'J\'étais dans une forêt sombre et dense, à la recherche d\'un refuge pour la nuit. Soudain, je me suis retrouvé face à une créature cauchemardesque, avec des yeux rouges brillants et des griffes acérées. Elle m\'a poursuivi sans relâche, jusqu\'à ce que je tombe dans un trou sombre et profond. En bas, j\'ai découvert un tunnel effrayant rempli de squelettes et de chauve-souris. J\'ai crié pour de l\'aide, mais personne n\'a répondu. J\'ai finalement réalisé que j\'étais piégé dans ce cauchemar sans fin.','2023-04-16',2,114,32,'Bizarre...','');
